import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';

const red = `#f54e4e`;
const green = `#4aec8c`;

function Timer() {
    return(
        <CircularProgressbar value={60} text={`60%`} styles={buildStyles({rotation: 0.25, strokeLinecap: 'butt', textSize: '40px',  pathTransitionDuration: 0.5, 
            textColor: '#fff',
            pathColor: red,
            trailColor: 'rgba(255, 255, 255, .2)'

        })} />
    );
}

export default Timer;
